import React from 'react';
import {Link} from 'react-router-dom';

export default function Nav(props) {
    const folders = props.folderList.map(folder =>
        <li key={folder.id} className="folder-menu-list-item">
            <Link to={`/${folder.id}`}>
                {folder.name}
            </Link>
        </li>
    );
  return (
    <nav className="folder-menu">
        <div key="" className="folder-menu-list-item profile">
            <Link to="./profilepage">PROFILE</Link>
        </div>
        <ul className="folder-menu-list">
            <li className="folder-menu-list-item kitchen">
                <a href="/inbox">KITCHEN</a>
            </li>
            <li className="folder-menu-list-item meals">
                <a href="/spam">MEALS</a>
            </li>
        </ul>
    </nav>
  );
}

<Link to="/users" style={{color: 'white'}} activeStyle={{color: 'red'}}>Users</Link>
